import React, { Component } from 'react';
import ResultsAPI from "../../API/ResultsAPI";

class RecentResults extends Component<any,any> {
    constructor(props: any) {
        super(props);
        this.state = {
            recentinfo: [],
        };
    }

    async componentDidMount() {
        const resultApi: ResultsAPI = new ResultsAPI()
        const recentinfo: any[] = await resultApi.Recent();
        console.log(recentinfo)
       this.setState({ recentinfo });
    }
    render() {
        return (
            <div className={"flex flex-raw justify-center items-top h-[50%] w-[70%] p-10 bg-orange-800"}>
                <h1>{this.state.recentinfo[-1].location}</h1>
                <h2>{this.state.recentinfo[-1].date}</h2>
                <h2>{this.state.recentinfo[-1].time}</h2>
                <h2>{this.state.recentinfo[-1].season}</h2>
                {this.state.recentinfo.map((elem: any, key:number)=>(
                    <div key={key}>
                        elem.number
                        elem.constructor
                        elem.driver
                        elem.points
                        elem.position
                        elem.status
                    </div>
                ))}
            </div>
        );
    }
}

export default RecentResults;
